class Solution(object):
    def myPow(self, base, exp, mod=None):
        if mod is None:
            mod = 10 ** 9 + 7
        ans = 1
        for _ in range(exp):
            ans = (ans * base) % mod
        return ans

    def myPref(self, x, y):
        ans = 0
        while y > 0:
            ans = (10 * ans) + x
            x = self.myPow(1000, y)
            if x % 1000 == 0:
                ans = 10 * ans + x
        return ans

    def myFrac(self, x, n):
        res = 0
        if (x >= 0) and (n >= 0):
            res = (int(x / abs(1000 * x)) * n / 1000)
            res = (res + n / 10) if (n % 100) else res
        else:
            res = (n * abs(x) / 100)                  
            res = (x % 100 if (x >= 100) and (res % 100 < 0) else 0 if (res % 1) else res)
        return self.myPref(res, n)
